import React from "react";

export default function Registro() 
{
    return(
        <div className="container mt-5">
            <div className="row">
                <div className="col-md-12">
                    <h3>Registrarse</h3>
                    <form>
                        <div className="form-group">
                            <label>Nombres</label>
                            <input type="text" className="form-control" placeholder="Nombres"></input>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    )
}
